INSERT INTO `Project` (`Project_id`,`Title`,`Summary`,`Funding_amount`,`Start_date`,`Finish_date`,`Program_id`,`Executive_id`,`Org_id`,`Researcher_id_sup`,`Researcher_id_eval`,`Eval_date`,`Eval_grade`) VALUES ('68','Project Lobster_I','This project is about the use of a new technology called 3D printing to create a prosthetic hand. The hand will be designed using a 3D modeling program called Blender.','187786','2021-04-14','2023-08-30','5','20','19','91','11','2020-07-23','7.8');
INSERT INTO `Project` (`Project_id`,`Title`,`Summary`,`Funding_amount`,`Start_date`,`Finish_date`,`Program_id`,`Executive_id`,`Org_id`,`Researcher_id_sup`,`Researcher_id_eval`,`Eval_date`,`Eval_grade`) VALUES ('69','Project Blaufuchs_1','This project is about the development of a new method for the analysis of protein-protein interactions in vivo. This method is based on the use of the split ubiquitin system, which consists of two parts: the first part is the ubiquitin ligase E3, and the second part is the ubiquitin-binding domain (UBA) of the E2 ubiquitin-conjugating enzyme.','992307','2021-01-07','2023-06-18','30','8','19','91','49','2020-10-20','7.7');
INSERT INTO `Project` (`Project_id`,`Title`,`Summary`,`Funding_amount`,`Start_date`,`Finish_date`,`Program_id`,`Executive_id`,`Org_id`,`Researcher_id_sup`,`Researcher_id_eval`,`Eval_date`,`Eval_grade`) VALUES ('70','Project Pastorius','This project is about creating a new type of robot, the Multi-Robot System, which will be able to work together to complete a complex task. The robots will be able to learn and adapt to the task and environment.','516536','2021-11-16','2023-11-17','6','11','19','91','57','2021-03-02','5.8');
INSERT INTO `Project` (`Project_id`,`Title`,`Summary`,`Funding_amount`,`Start_date`,`Finish_date`,`Program_id`,`Executive_id`,`Org_id`,`Researcher_id_sup`,`Researcher_id_eval`,`Eval_date`,`Eval_grade`) VALUES ('71','Project Teardrop','This project is about the development of a new approach to the design of a computer-based learning system. The project is based on the idea of using computer-based learning to facilitate the learning process of the students.','611669','2021-02-13','2023-08-08','7','4','20','96','56','2020-12-10','8.8');
INSERT INTO `Project` (`Project_id`,`Title`,`Summary`,`Funding_amount`,`Start_date`,`Finish_date`,`Program_id`,`Executive_id`,`Org_id`,`Researcher_id_sup`,`Researcher_id_eval`,`Eval_date`,`Eval_grade`) VALUES ('72','Project Crimson','This project is about the creation of a new generation of game controllers for the PC. The goal is to make game controllers that are easy to use and offer a great experience for the players.','659996','2020-11-12','2023-08-12','14','4','20','96','38','2020-08-15','6.7');
INSERT INTO `Project` (`Project_id`,`Title`,`Summary`,`Funding_amount`,`Start_date`,`Finish_date`,`Program_id`,`Executive_id`,`Org_id`,`Researcher_id_sup`,`Researcher_id_eval`,`Eval_date`,`Eval_grade`) VALUES ('73','Project Seagull_II','This project is about the development of a new kind of portable, modular, and sustainable solar-powered home. This is a project that is about living in the future, and about how we can live in a sustainable way in the future.','360273','2021-04-06','2023-06-22','13','18','20','96','1','2021-01-09','6.2');
INSERT INTO `Project` (`Project_id`,`Title`,`Summary`,`Funding_amount`,`Start_date`,`Finish_date`,`Program_id`,`Executive_id`,`Org_id`,`Researcher_id_sup`,`Researcher_id_eval`,`Eval_date`,`Eval_grade`) VALUES ('74','Project Matterhorn','This project is about creating a new type of vehicle that is more fuel efficient and can be used in urban areas. The vehicle is a hybrid of a motorcycle and a bicycle and has a unique steering mechanism. It is intended to be used as a personal vehicle for commuting, touring and recreational purposes.','560086','2020-08-07','2022-11-04','19','1','21','101','4','2019-09-01','9.0');
INSERT INTO `Project` (`Project_id`,`Title`,`Summary`,`Funding_amount`,`Start_date`,`Finish_date`,`Program_id`,`Executive_id`,`Org_id`,`Researcher_id_sup`,`Researcher_id_eval`,`Eval_date`,`Eval_grade`) VALUES ('75','Project Alacrity','This project is about the development of a new generation of high-power laser systems for use in the aerospace industry. The laser systems will be based on the use of the CO2 laser.','735046','2020-11-05','2023-01-21','8','9','21','101','27','2020-01-02','6.1');
INSERT INTO `Project` (`Project_id`,`Title`,`Summary`,`Funding_amount`,`Start_date`,`Finish_date`,`Program_id`,`Executive_id`,`Org_id`,`Researcher_id_sup`,`Researcher_id_eval`,`Eval_date`,`Eval_grade`) VALUES ('76','Project Ikarus','This project is about the development of a new kind of robot, which is able to autonomously explore a space and explore the objects in the space. The robot has to learn the environment by itself, and then it has to learn how to interact with the objects.','398615','2021-12-17','2023-04-07','5','18','21','101','26','2020-12-27','6.7');
INSERT INTO `Project` (`Project_id`,`Title`,`Summary`,`Funding_amount`,`Start_date`,`Finish_date`,`Program_id`,`Executive_id`,`Org_id`,`Researcher_id_sup`,`Researcher_id_eval`,`Eval_date`,`Eval_grade`) VALUES ('77','Project Musketoon','This project is about the development of a new type of engine for the future of the automotive industry. It is based on the concept of a modular engine, which is designed to be easily replaceable and upgradable.','714190','2020-12-11','2023-08-03','25','9','22','106','58','2020-02-09','10.0');
